import Typical from "react-typical";

function Profile() {
  return (
    <div
      className="profile-container"
      style={{
        backgroundImage: `url("assets/images/download.jpg 5")`,
        backgroundRepeat: "no-repeat",
        width: "100%",
        height: "600px",
        backgroundSize: "cover",
      }}
    >
      <div className="profile-parent row">
        <div className="col">
            <img src="assets/images/download.jpg" alt="" />
        </div>

        <div className="col">

        </div>
      </div>
    </div>
  );
}

export default Profile;
